import ReactDom from "react-dom";
// import App from './App';
// import './App.css';

function greeting(name) {
  const date = new Date();
  const hours = date.getMilliseconds();

  let timeOfDay;

  if (hours >= 1 && hours <= 10) {
    timeOfDay = 'Morning';
  } else {
    timeOfDay = 'Afternoon';
  }

  console.log(hours);

  return `Good ${timeOfDay}, ${name} !`;
}

greeting("Le Roy");

ReactDom.render(<h1>{greeting("Le Roy")}</h1>, document.getElementById("root"));
